Infection rates at 7 dpi ranged from 18% to 40% for the four DENV serotypes, with no significant difference (
 Fig 1A; 
 S1 Table). At 14 dpi, infections rates ranged from 20% to 58%, with a significant lower infection rate for the DENV-4 strain compared to the others DENV (Fisher’s exact test: 
 p-values = 0.03, < 0.001, = 0.02 and < 0.001, respectively for DENV-1 genotype I “Asia”, DENV-1 genotype IV “Pacific”, DENV-2 and DENV-3; 
 Fig 1A). Results obtained from the log-linear model (
 S2 Table) showed that the infection rate was significantly higher at 14 dpi (OR = 2.04, 95%CI: 1.37–3.04). Infection rate was also significantly higher for DENV-1 genotype IV “Pacific” compared to DENV-4 as reference, after considering results of the univariate analysis (OR = 2.88, 95%CI: 1.53–5.4).
